### Psychometric &amp; Genomic Integration

1. The Handelsman and Davidson Labs designed a longitudinal study to evaluate
the relationship between mindfulness and the microbiome. The treatment group
received meditation training.
1. The study generated psychometric and microbiome data, and
ongoing collection is gathering additional immunological and behavioral data
2. Changes in one might be associated with effects across all. To approach this, we use the language of graphical modeling.

.center[
&lt;img src="figures/microbe-mind.svg" width=420/&gt;
]

---

### Mediation Analysis

Mediation models are a type of graphical model where a treatment `\(T\)` can
influence a response `\(Y\)` either directly or indirectly through a mediator
variable `\(M\)`. This is formalized through a series of chained regression models,

`\begin{align*}
M &amp;= \alpha_{0} + \alpha_{T}T + \alpha_{X}^{T}X + \varepsilon^{M} \text{ (mediation model)}\\
Y &amp;= \beta_{0} + \beta_{T}T + \beta_{X}^{T}X + \beta_{M}^{T}M + \varepsilon^{Y} \text{ (outcome model) }.
\end{align*}`

&lt;img src="figures/mediation-dag.svg" width="300" style="display: block; margin: auto;" /&gt;

---

### Counterfactual Perspective

* Typically the direct and indirect effects are read off `\(\alpha_{T}\)` and
`\(\beta_{T}\)`.
* A more general approach considers the counterfactual difference in potential outcomes [1; 2],
`\begin{align}
\tau\left(t'\right) &amp;= \Earg{Y\left(X, 1, M\left(X, t'\right)\right) - Y\left(X,0, M\left(X, t'\right)\right)},\\
\delta\left(t'\right) &amp;= \Earg{Y\left(X, t', M\left(X, 1\right)\right) - Y\left(X, t', M\left(X, 0\right)\right)},
\end{align}`
  where the expectation is over draws `\(X\)`, `\(\varepsilon^{M}\)`, and
  `\(\varepsilon^{Y}\)` from the population.
* `\(\tau\)` and `\(\delta\)` are viewed as intervening on the treatment and mediator,
respectively

---
### Counterfactual Perspective

For example, if there is no mediation effect, `\(M\)` is unaffected by the
treatment. Nonetheless, there can still be a large direct effect.

&lt;img src="figures/counterfactual-mediation2.svg" width="540" style="display: block; margin: auto;" /&gt;

---
### Counterfactual Perspective

Alternatively, the treatment can influence the response entirely by changing the
typical value of the mediator.

&lt;img src="figures/counterfactual-mediation3.svg" width="600" style="display: block; margin: auto;" /&gt;

---
### Counterfactual Perspective

Both types of effects can exist simultaneously.

&lt;img src="figures/counterfactual-mediation4.svg" width="700" style="display: block; margin: auto;" /&gt;

---

### Logistic Normal Multinomial

We developed a suite of mediation models based on the Logistic Normal
Multinomial (LNM),

.pull-left[
`\begin{align*}
Y &amp;\sim \Mult\left(n, \varphi^{-1}\left(X^{T}\beta\right)\right) \\
\beta &amp;\sim \Gsn\left(0, \diag\left(\sigma_{k}^{2}\right)\right)
\end{align*}`
where `\(\varphi^{-1}\left(z\right) \propto\left(\exp{z_{1}}, \dots, \exp{z_{K-1}}, 1\right)\)` and `\(n\)` denotes sequencing depth.
]

.pull-right[
&lt;img src="figures/lnm.svg" style="display: block; margin: auto;" /&gt;
]

---

### Logistic Normal Multinomial Mediation

We incorporate the mediator path in an LNM model.

`\begin{align*}
Y &amp;\sim \Mult\left(n, \varphi^{-1}\left(\mu\right)\right) \\
\mu &amp;= \beta_0 + \beta_T T + \beta_X^T X + \beta_M^T M + \varepsilon^{\eta} \\ 
M &amp;= \alpha_0 + \alpha_T T + \alpha_X^T X + \varepsilon^m\\
\end{align*}`

&lt;img src="figures/lnm_med_model_causal.png" width="700" style="display: block; margin: auto;" /&gt;

---

### ZINQ-based Model Comparison

1. We compare models using a semisynthetic simulator, following [3].
2. This approach estimates a CDF for each species using,
`\begin{align*}
 \logit{\Parg{Y &gt; 0 \vert X}} = \gamma_{0} + \gamma^{T}X \\
 Q_{Y}\left(\tau \vert X, Y &gt; 0\right) =\xi_{0}\left(\tau\right) + \xi\left(\tau\right)^{T}X
\end{align*}`
    where `\(Q_{Y}\left(\tau \vert X, Y &gt; 0\right)\)` is the conditional `\(\tau^{th}\)` quantile of a nonzero count.

.center[
&lt;img src="figures/zinq.png" width=400/&gt;
]

---

### Simplified Setting

* Let's see how simulation strategies compare on a simple setup.
* Consider the problem of evaluating an LNM model. We will compare estimation
quality when we simulate from,
 - The LNM itself
 - A simulator based on a pilot dataset

---

### Synthetic Setup

In the first simulation, we simulate from a version of the LNM,

`\begin{align*}
Y &amp;\sim \Mult\left(N_{i}, \varphi^{-1}\left(\xi_{0} + \xi_{T}T\right)\right) \\
\xi_{T} &amp;:= \text{HardThreshold}\left(\tilde{\xi}_{T}, \text{keep 25%}\right) \\
\xi_{0}, \tilde{\xi}_{T} &amp;\sim \Gsn\left(0, I_{K}\right) \\
\end{align*}`

.center[
&lt;img src="figures/lnm-spherical.png" width=500/&gt;
]

---

### Semisynthetic Setup

In the second, we use the exact same `\(\xi_{T}\)`, but now to exponentially tilt
samples from treatment,

`\begin{align*}
Y \sim \Mult\left(N_{i}, \exp{\xi_{T}T}\odot \hat{p}^{\ast}\right)
\end{align*}`
Here, `\(\hat{p}^{\ast}\)` is drawn randomly with replacement from compositions
in an observed pilot dataset (the meditation study data, in this case).

---

### Simulation Comparison

The purely synthetic simulation setup leads to overoptimistic power and FSR
estimates, compared to the semisynthetic setup.

.center[
&lt;img src="figures/semisynthetic_comparison.png" width=950/&gt;
]

### Graphical ZINQ

1. We can adapt this to the graphical model setting by estimating nonparametric relationships across edges.
2. We can estimate ground truth direct and indirect effects by simulating from known `\(\gamma\)` and `\(\xi\left(\tau\right)\)`.

.center[
&lt;img src="figures/mediation-assumptions.svg" width=570/&gt;
]

---

### Graphical ZINQ

1. We can adapt this to the graphical model setting by estimating nonparametric relationships across edges.
2. We can estimate ground truth direct and indirect effects by simulating from known `\(\gamma\)` and `\(\xi\left(\tau\right)\)`.


```r
simulator &lt;- dataset_generator(x, m, trt, y) # covariates, mediators, treatment, abundances
params &lt;- expand.grid(sparsity = 0.5, scale = seq(0.1, 5, length.out = 10))
metrics &lt;- power_analysis(simulator, params)
```

### R Package

We have written an R package that to support these modeling and evaluation
techniques.



```r
library(LNMmediation)
library(phyloseq)
data(mindfulness)

var_names &lt;- colnames(sample_data(mindfulness))
mediator_ix &lt;- grepl("mediator", var_names)
id_vars &lt;- c("subject", "timepoint")
input_data &lt;- phyloseq_mediators(mindfulness, var_names[mediator_ix], id_vars)
```

---


```r
fit &lt;- lnm_mediation(model_conf(baseline = TRUE), input_data, raw_output = TRUE)
```

rect\")\n    .data(bars).enter()\n    .append(\"rect\")\n    .attrs({\n      y: d => scales.y_samples(d.rank),\n      x: d => scales.x_quantile(d.min),\n      width: d => scales.x_quantile(d.max) - scales.x_quantile(d.min),\n      height: 0.5,\n      class: \"subject\"\n    })\n\n  div.select(\"#taxon #values\")\n    .selectAll(\"circle\")\n    .data(points).enter()\n    .append(\"circle\")\n    .attrs({\n      cx: d => scales.x_quantile(d.abundance),\n      cy: d => scales.y_samples(d.rank),\n      fill: d => scales.fill_treatment(d.treatment == 1),\n      r: 2\n    })\n\n  neighbors = d3.Delaunay.from(bars.map(d => [125, scales.y_samples(d.rank)]))\n  div.select(\"#taxon #values #hover\").on(\"mousemove\", ev => reveal_subject(ev, bars, neighbors, scales))\n  let x_axis = d3.axisBottom(scales.x_quantile).ticks(4)\n  div.select(\"#taxon #values_axis\").call(x_axis)\n  div.select(\"#taxon #values_axis_copy\").call(x_axis)\n}\n\nfunction rect_width(d, x_quantile) {\n  let diff = x_quantile(d3.max([d[\"0\"], d[\"1\"]])) - x_quantile(d3.min([d[\"0\"], d[\"1\"]]))\n  return diff < 2 ? 2 : diff\n}\n\nfunction draw_quantiles(quantiles, scales, path_data) {\n  div.select(\"#taxon #quantile\")\n    .selectAll(\"rect\")\n    .data(quantiles).enter()\n    .append(\"rect\")\n    .attrs({\n      x: d => scales.x_quantile(d3.min([d[\"0\"], d[\"1\"]])),\n      y: d => scales.y_quantile(d.quantile),\n      width: d => rect_width(d, scales.x_quantile),\n      height: scales.y_quantile(0.95),\n      fill: d => scales.fill_treatment(!d.treat_larger),\n      opacity: 0.1\n    })\n\n    let line_generator = d3.line()\n      .x(d => scales.x_quantile(d.abundance))\n      .y(d => scales.y_quantile(d.quantile))\n      .curve(d3.curveStepAfter)\n\n    div.select(\"#taxon #quantile\")\n      .selectAll(\"path\")\n      .data(path_data).enter()\n      .append(\"path\")\n      .attrs({\n        d: line_generator,\n        stroke: d => scales.fill_treatment(d[0].treatment == 1),\n        opacity: 0\n      })\n}\n\nfunction append_header(text, transform) {\n  div.select(\"#headers\")\n    .append(\"text\")\n    .text(text)\n    .attr(\"transform\", transform)\n}\n\nfunction draw_headers() {\n  append_header(\"Effect Estimates\", \"translate(50,15)\")\n  append_header(\"Relative Abundance CDF\", \"translate(200,15)\")\n  append_header(\"Subject-Level Relative Abundance\", \"translate(200,240)\")\n}\n\nfunction update_axis(x_quantile) {\n  let x_axis = d3.axisBottom(x_quantile).ticks(4)\n  div.select(\"#taxon #values_axis\")\n    .transition().duration(transition_length)\n    .call(x_axis)\n\n  div.select(\"#taxon #values_axis_copy\")\n    .transition().duration(transition_length)\n    .call(x_axis)\n}\n\nfunction update_taxon(ev, data, interval_centers, intervals, path_data) {\n  let pos = d3.pointer(ev),\n    ix = interval_centers.find(pos[0], pos[1]),\n    taxon = intervals[ix].Taxon\n\n  let scales = make_scales(data, taxon)\n  update_quantiles(taxon, scales, data[3], path_data)\n  update_samples(taxon, scales, data[2], data[1])\n  update_intervals(taxon, intervals)\n  update_axis(scales.x_quantile)\n}\n\nfunction update_quantiles(taxon, scales, quantiles, path_data) {\n  div.select(\"#taxon #quantile\")\n    .selectAll(\"rect\")\n    .transition().duration(transition_length)\n    .attrs({\n      x: d => scales.x_quantile(d3.min([d[\"0\"], d[\"1\"]])),\n      width: d => rect_width(d, scales.x_quantile),\n      opacity: d => d.taxon == taxon ? .7 : 0.05\n    })\n\n  let line_generator = d3.line()\n    .x(d => scales.x_quantile(d.abundance))\n    .y(d => scales.y_quantile(d.quantile))\n    .curve(d3.curveStepAfter)\n\n  div.select(\"#taxon #quantile\")\n    .selectAll(\"path\")\n    .data(path_data)\n    .transition().duration(transition_length)\n    .attrs({\n      d: line_generator,\n      opacity: d => d[0].taxon == taxon ? .8 : 0\n    })\n}\n\nfunction update_samples(taxon, scales, points, bars) {\n  points = points.filter(d => d.taxon == taxon)\n  bars = bars.filter(d => d.taxon == taxon)\n  div.select(\"#taxon #values\")\n    .selectAll(\"circle\")\n    .data(points)\n    .transition().duration(transition_length)\n    .attrs({\n      cx: d => scales.x_quantile(d.abundance),\n      cy: d => scales.y_samples(d.rank),\n    })\n\n  div.select(\"#taxon #values\")\n    .selectAll(\".subject\")\n    .data(bars)\n    .transition().duration(transition_length)\n    .attrs({\n      y: d => scales.y_samples(d.rank),\n      x: d => scales.x_quantile(d.min),\n      width: d => scales.x_quantile(d.max) - scales.x_quantile(d.min),\n    })\n\n  neighbors = d3.Delaunay.from(bars.map(d => [125, scales.y_samples(d.rank)]))\n  div.select(\"#values #hover\").on(\"mousemove\", ev => reveal_subject(ev, bars, neighbors, scales))\n}\n\nfunction update_intervals(taxon, intervals) {\n  div.select(\"#taxon #ci\")\n    .selectAll(\"circle\")\n    .data(intervals, d => d.Taxon)\n    .attrs({ r: d => d.Taxon == taxon ? 2: 0.5 })\n\n  div.select(\"#taxon #ci\")\n    .selectAll(\".interval\")\n    .data(intervals, d => d.Taxon)\n    .attrs({ \"stroke-width\": d => d.Taxon == taxon ? 2: 0.5 })\n\n  div.select(\"#taxon #labels\")\n    .selectAll(\"text\")\n    .data(intervals, d => d.Taxon)\n    .attrs({ \"font-size\": d => d.Taxon == taxon ? 10 : 6 })\n\n  div.select(\"#subject text\").text(\"\")\n}\n\nfunction visualize(data) {\n  setup_canvas()\n  let [intervals, bars, points, quantiles] = data;\n  let scales = make_scales(data, points[0].taxon);\n  let path_data = nest_paths(quantiles)\n  draw_intervals(intervals, scales, \"direct\")\n  draw_samples(bars, points, scales)\n  draw_quantiles(quantiles, scales, path_data)\n  draw_headers()\n\n  intervals = intervals.filter(d => d.type == \"direct\")\n  let interval_centers = delaunay_centers(intervals, scales)\n  div.select(\"#taxon #ci\")\n    .select(\"rect\")\n    .on(\"mousemove\", ev => update_taxon(ev, data, interval_centers, intervals, path_data))\n\n  div.select(\"#taxon #labels\")\n    .on(\"mousemove\", ev => update_taxon(ev, data, interval_centers, intervals, path_data))\n\n  div.select(\"#effect_selector\")\n    .on(\"change\", ev => reorder_intervals(ev, data, scales, path_data))\n}\n\nfunction reveal_subject(ev, bars, neighbors, scales) {\n  let pos = d3.pointer(ev)\n  let ix = neighbors.find(pos[0], pos[1])\n\n  div.select(\"#taxon #values\")\n    .selectAll(\".subject\")\n    .attrs({ height: e => e.subject == bars[ix].subject ? 2 : 0.5 })\n\n  div.select(\"#taxon #values\")\n    .selectAll(\"circle\")\n    .attrs({ r: e => e.subject == bars[ix].subject ? 4 : 2 })\n\n  div.select(\"#taxon #subject\")\n    .select(\"text\")\n    .text(bars[ix].subject)\n    .attrs({\n      transform: `translate(${10 + scales.x_quantile(bars[ix].max)}, ${scales.y_samples(bars[ix].rank)})`\n    })\n}\n\nfunction reorder_intervals(ev, data, scales, path_data) {\n  let effect_type = div.select(\"#effect_selector\").property(\"value\")\n  let intervals = data[0].filter(d => d.type == effect_type)\n  let interval_centers = delaunay_centers(intervals, scales)\n\n  div.select(\"#taxon #ci\")\n    .select(\"rect\")\n    .on(\"mousemove\", ev => update_taxon(ev, data, interval_centers, intervals, path_data))\n  div.select(\"#taxon #labels\")\n    .on(\"mousemove\", ev => update_taxon(ev, data, interval_centers, intervals, path_data))\n\n  div.select(\"#taxon #ci\")\n    .selectAll(\"circle\")\n    .data(intervals, d => d.Taxon)\n    .transition().duration(transition_length)\n    .attrs({\n      r: 2,\n      cx: d => scales.x_interval(d.estimate),\n      cy: d => scales.y_interval(d.rank)\n    })\n\n  div.select(\"#taxon #ci\")\n    .selectAll(\".interval\")\n    .data(intervals, d => d.Taxon)\n    .transition().duration(transition_length)\n    .attrs({\n      x1: d => scales.x_interval(d.lwr),\n      x2: d => scales.x_interval(d.upr),\n      y1: d => scales.y_interval(d.rank),\n      y2: d => scales.y_interval(d.rank),\n      \"stroke-width\": 2\n    })\n\n  div.select(\"#taxon #labels\")\n    .selectAll(\"text\")\n    .data(intervals, d => d.Taxon)\n    .transition().duration(transition_length)\n    .attrs({\n      transform: d => `translate(0, ${scales.y_interval(d.rank)})`,\n      \"font-size\": 6,\n    })\n}\n\nfunction delaunay_centers(intervals, scales) {\n  return d3.Delaunay.from(\n    intervals.map(d => [50, scales.y_interval(d.rank)])\n  )\n}\n\nfunction setup_canvas() {\n  div.append(\"div\")\n    .append(\"select\")\n    .attrs({id: \"effect_selector\", name: \"effect\"})\n    .selectAll(\"option\")\n    .data([\"Direct\", \"Indirect\"]).enter()\n    .append(\"option\")\n    .attr(\"value\", d => d.toLowerCase())\n    .text(d => d)\n\n  let taxon_div = div.append(\"svg\")\n    .attrs({ height: 450, width: 450 })\n    .append(\"g\")\n    .attr(\"id\", \"taxon\")\n    .append(\"g\")\n\n  taxon_div.append(\"g\")\n    .attrs({id: \"labels\", transform: \"translate(80, 30)\", \"font-family\": \"Oswald\"})\n  taxon_div.append(\"g\").attr(\"id\", \"headers\")\n  taxon_div.append(\"g\")\n    .attrs({\n      id: \"ci\",\n      transform: \"translate(80, 30)\"\n    })\n    .append(\"line\")\n    .attr(\"class\", \"zero_line\")\n\n  div.select(\"#ci\")\n    .append(\"rect\")\n    .attrs({\n      width: 100, height: 410, opacity: 0\n    })\n\n  taxon_div.append(\"g\")\n    .attrs({\n      id: \"quantile\",\n      transform: \"translate(180, 25)\"\n    })\n  taxon_div.append(\"g\")\n    .attrs({\n      id: \"value_axis\",\n      transform: \"translate(180, 190)\"\n    })\n  taxon_div.append(\"g\")\n    .attrs({\n      id: \"value_axis_copy\",\n      transform: \"translate(180, 430)\"\n    })\n  taxon_div.append(\"g\")\n    .attrs({\n      id: \"values\",\n      transform: \"translate(180, 250)\"\n    })\n    .append(\"g\")\n    .attr(\"id\", \"subject\")\n    .append(\"text\")\n\n  div.select(\"#values\")\n    .append(\"rect\")\n    .attrs({\n      id: \"hover\", width: 250, height: 200, opacity: 0\n    })\n}\n\nconsole = d3.window(div.node()).console;\nlet transition_length = 1000\ndata = data.map(HTMLWidgets.dataframeToD3)\nvisualize(data)\n};","style":"/* R2D3 Source File:  /Library/Frameworks/R.framework/Versions/4.2/Resources/library/LNMmediation/d3/outcome_vis.css */\n\n@import url('https://fonts.googleapis.com/css2?family=Open+Sans&family=Oswald&display=swap');\n\n#taxon #labels {\n  font-family: 'Open Sans', sans-serif;\n  text-anchor: end;\n}\n\n#taxon #ci circle {\n  fill: #323640\n}\n\n#taxon #ci .interval {\n  stroke: #323640\n}\n\n#taxon #ci .zero_line {\n  stroke: #D9D8D7\n}\n\n#taxon .subject {\n  fill: #B0B7BF\n}\n\n#taxon #quantile path {\n  fill: none;\n  stroke-width: 2px;\n}\n\n#taxon #subject text {\n  font-family: 'Open Sans', sans-serif;\n  font-size: 12px;\n}\n\n#headers text {\n  font-family: 'Oswald', sans-serif;\n  font-size: 15px;\n}","version":6,"theme":{"default":{"background":"#FFFFFF","foreground":"#000000"},"runtime":null},"useShadow":true},"evals":[],"jsHooks":[]}</script>
